Acquire images with the device camera in Xamarin Forms with the CameraProvider component. Supports Android, iOS, and UWP.
The CameraProvider component uses native Camera components on each platform. **************** In your iOS project "AppDelegate" code file, you must call "Rox.CameraIos.Init()" before "Xamarin.Forms.Forms.Init()". It should look something like: ---------------- Rox.CameraIos.Init();
global::Xamarin.Forms.Forms.Init();
LoadApplication(new MyCameraApplication()); **************** The CameraProvider component has the following methods: - Task<ImageSource> AcquirePicture(); (Take a picture with the device camera) ****************

